import { v4 as uuidv4 } from "uuid";
import { data } from "./data";
import { T_ShoppingData } from "./types";

export const generateRandomProducts = () => {
  return [
    {
      id: uuidv4(),
      name: "Himalayan Green tea mint flavour",
      amount: 3,
    },
    {
      id: uuidv4(),
      name: "Himalayan Green tea mint flavour",
      amount: 3,
    },
    {
      id: uuidv4(),
      name: "Chicken boneless spicy",
      amount: 1,
    },
    {
      id: uuidv4(),
      name: "Orange juice with bits",
      amount: 2,
    },
    {
      id: uuidv4(),
      name: "Cucumber suomalainen",
      amount: 2,
    },
    {
      id: uuidv4(),
      name: "Fazer dark chocolate",
      amount: 1,
    },
  ];
};
export const saveData = (newData: T_ShoppingData[]) => {
  data.concat(...newData);
};
